VALUES ('3256225451708', 'Bouillon instantané de légumes', 'Ingrédients du bouillon déshydraté : Sel de mer, maltodextrine*, légumes* 16% (oignon* 7,1%, carotte* 5,9%, poivron rouge*, poireau* 0,6%), sucre de canne brut*, épices* 2% (muscade*, curcuma*, gingembre*), huile de tournesol*, plantes aromatiques* 0,5% (feuilles de livèche*, persil*), ail* 0,4%. * Ingrédient issu de l\'agriculture biologique. Traces éventuelles de céréales contenant du gluten, crustacés, oeuf, poisson, soja, lait, céleri, moutarde', 'https://static.openfoodfacts.org/images/products/325/622/545/1708/front_fr.36.400.jpg', '1.3', '0.4', '40', '18', '5.7', '2', '45.9', '18.0708661417323', '', '0');

