INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256225812295', 'Trio de bouchées croustillantes', 'Beignet de fromage : pâte à beignet 35%* (amidon transformé de maïs, farine de BLE, fécule de pomme de terre, poudre à lever : diphosphates et carbonate de sodium, sucre, sel, extrait de levure, épaississant : gomme xanthane et gomme guar, piment de Cayenne, maltodextrine, dextrose), eau, MOZZARELLA 22.2%* (LAIT de vache pasteurisé, sel, ferments LACTIQUES, coagulant, correcteur d\'acidité : acide citrique), poivron rouge préfrit (poivron rouge, huile de tournesol), huile de tournesol, cumin, arôme naturel (contient LAIT), piment de Cayenne, gingembre en poudre, sel, épaississants : gomme xanthane et gomme guar, poudre de muscade, dextrose. Triangle de pâte fine au blé garni d\'une farce de thon : Garniture 71%* : miettes de THON albacore à l\'eau 30.2%* (THON albacore 28.9%*, eau, sel), omelette (OEUF entier, blanc d\'OEUF, LAIT écrémé, huile de tournesol, sel, épaississants : gomme xanthane et gomme guar, acidifiant : acide citrique), oignon, OEUF entier liquide, eau, poivron rouge préfrit (poivron rouge, huile de tournesol), préparation déshydratée pour base béchamel (amidon transformé de maïs et de pomme de terre, LACTOSERUM, huile de tournesol, sirop de glucose et protéine de LAIT, LAIT entier et LAIT écrémé en poudre, LACTOSE, sel, épaississant : carraghénanes, poivre, muscade), ail, zeste de citron, piment de Cayenne, cumin, coriandre, anis vert, cannelle, dextrose. Pâte au blé 29%* : eau, farine de BLE, blanc d\'OEUF en poudre, huile de tournesol, OEUF entier en poudre, sel farines de fèves, GLUTEN DE BLE, farine de BLE maltée, levure désactivée. Aumônière de pâte fine au blé garnie d\'une farce à base de poulet : Garniture 71%* : blanc de poulet cuit traité en salaison 31.5%* (filet de poulet (origine : France) 30.2%*, amidon transformé de manioc, sel), courgette grillée, BEURRE, poivron rouge préfrit (poivron rouge, huile de tournesol), raisin sec, carotte, huile d\'olive vierge extra, citron confit (citron, sucre, acidifiant : acide citrique, antioxydant : méthylcellulose, farine de graines de carouble, fibre de BLE, zeste de citron, coriandre, persil, sel, épices (coriandre, curcuma, fenouil, fenugrec, cumin, ail, poivre noi, chili, sel), cannelle, dextrose. Pâte au blé 29%*: eau, farine de BLE, blanc d\'OEUF en poudre, huile de tournesol, OEUF entier en poudre, sel, farine de fèves, GLUTEN DE BLE, farine de BLE maltée, levure désactivée. *Pourcentages exprimés sur chaque bouchée croustillante. Traces possible de : moutarde, soja, fruits à coque, sésame, mollusque, crustacé, céleri.', 'https://static.openfoodfacts.org/images/products/325/622/581/2295/front_fr.26.400.jpg', '18', '3.5', '18', '2.8', '3.1', '9.9', '1.6', '0.62992125984252', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256225812325', 'Assortiments Bouchées', 'Falafel : fève 31,9%* , pois chiche 27,2%*, oignon 15,9%*, huile de tournesol, farine de BLE, persil, poudre à lever (diphosphate disodique, carbonate acide de sodium, farine de BLE), ail, sel, coriandre, cumin, poivre blanc, piment de Cayenne, farine de fève, GLUTEN DE BLE, farine de BLE maltée, levure désactivée. Rouleau au poulet et épices douces : Garniture 71% : viande de poulet (origine : France) 24,5%*, filet de poulet cuit traité en salaison 8,1%* (filet de poulet (origine : France) 7,8%*, amidon modifié de manioc, sel), aubergine préfrite (aubergine, huile de tournesol), poivron rouge, oignon, pulpe de citron, noix de coco râpée, aromatisation 2,0%* (épices et aromates, sel, saccharose, lait de noix de coco en poudre, maltodextrine et protéine de LAIT, arômes, poivron, huile de SESAME grillée, huile de tournesol, sirop de glucose et protéine de LAIT, LACTOSE), poudre de lait (LAIT entier en poudre, émulsifiant : lécithine de SOJA), concentré de tomates, chapelure (contient : GLUTEN), sel, basilic, isolat de fibre de blé, ail. Pâte de blé 29 %: eau, farine de BLE, poudre de blanc d\'OEUF, huile de tournesol, poudre d\'OEUF entier, sel, farine de fèves, GLUTEN DE BLE, farine de BLE maltée, levure désactivée. Acras de morue : MORUE dessalée 41,5%*, eau, poivron rouge, oignon, amidon transformé de maïs, farine de BLE, pomme de terre déshydratée, fécule de pomme de terre, huile de tournesol, ciboulette, poudres à lever (diphosphate disodique, carbonate acide de sodium, farine de BLE), blanc d\'OEUF en poudre, LAIT en poudre (LAIT entier en poudre, émulsifiant: lécithine de SOJA), sel, ail, levure boulangère, épaississants : gomme xanthane et gomme de guar, piment de Cayenne 0,1%*, sucre, extrait de levure, maltodextrine, glucose. Triangle de pâte fine au blé garni d\'une farce à base de fromage frais et aux oignons : Garniture 71%: FROMAGE de chèvre 40,9%*, oignon 16,3%*, FROMAGE frais 8,2%, jaune d\'OEUF en poudre, ciboulette, pulpe de citron, huile de tournesol, sel, épaississants :gomme xanthane et gomme de guar, poivre blanc, glucose. Pâte de blé 29 %: eau, farine de BLE, blanc d\'OEUF en poudre, huile de tournesol, OEUF entier en poudre, sel, farine de fèves, GLUTEN DE BLE, farine de BLE maltée, levure désactivée. *Pourcentages exprimés sur chaque croustillant. Traces éventuelles de: céleri, crustacé, mollusque et fruits à coque.', 'https://static.openfoodfacts.org/images/products/325/622/581/2325/front_fr.29.400.jpg', '13', '3.3', '14', '1.9', '4.7', '9.9', '1.7', '0.669291338582677', '', '0');

