VALUES ('3256226070137', 'Assortiment vapeurs', '3 hacao au poulet (farce à base de poulet enrobée dans une pâte à base d\'amidon de blé) : Eau, poulet (France) 19%, amidon de BLE 12%, fécule de manioc, carotte, châtaigne d\'eau, oignon, oignon préfrit (oignon, huile de tournesol), courgette, protéines de SOJA, farine de BLE, ciboule, huile de tournesol, sel, arôme naturel, fibre de bambou, poivre. Soit 52% de farce et 48% de pâte dans le produit. Pourcentages exprimés sur l\'hacao au poulet.3 xiu mai aux crevettes (farce à base de crevette enrobée dans une pâte à base de farine de blé) : crevette décortiquée 34% (CREVETTE 33%, sel, conservateur : DISULFITE de sodium), farine de BLE 11%, châtaigne d\'eau, oignon, pousse de bambou, carotte, fécule de manioc, protéines de SOJA, eau, coriandre, arôme naturel (dont POISSONS), petit pois, pulpe d\'ail, huile de SESAME, sel, blanc d\'OEUF en poudre, poivre, curcuma. Soit 82.5% de farce et 17.5% de pâte dans le produit. Pourcentages exprimés sur le xui mai aux crevettes.3 funko aux légumes (farce à base de légumes enrobée dans une pâte à base de fécule de manioc) : eau, fécule de manioc 14%, amidon de BLE, châtaigne d\'eau 8%, chou vert 5%, oignon préfrit 4% (oignon, huile de tournesol), fève de SOJA 4%, courgette 4%, pousse de bambou 4%, carotte 3%, ciboule 3%, huile de tournesol, sel, lait de noix de coco en poudre (LAIT), curry (dont MOUTARDE), amidon de riz, champignon noir séché, poivre. Soit 55% de pâte et 45% de farce dans le produit. Pourcentages exprimés sur le funko aux légumes.Sauce aigre douce : eau, sucre, vinaigre d\'alcool, poivron rouge, amidon transformé de pomme de terre, jus d\'ananas concentré, sel, huile de colza, sauce soja (grains de SOJA, sel, eau, farine de BLE), épices, épaississants : gomme guar et gomme xanthane.Sauce soja : eau, sauce soja 35% (eau, graines de SOJA, sel, farine de BLE), sucre, jus de citron concentré, épaississants : gomme guar et gomme xanthane. Pourcentage exprimé sur la sauce soja.', 'https://static.openfoodfacts.org/images/products/325/622/607/0137/front_fr.10.400.jpg', '3.3', '0.7', '24.9', '1.4', '2.2', '6.3', '0.77', '0.303149606299213', '', '1');

