VALUES ('3256226085858', 'Curry de poulet, crevettes et riz,', 'Riz basmati cuit 35% (eau, riz basmati), émincé de filet de poulet assaisonné cuit rôti 14% [filet de poulet(origine: France) 13%, eau, fécule de manioc, sel,dextrose], eau, crevette décortiquée 9% [crevette (Litopenaeus vannamei ou Métapenaeus monoceros ou Penaeus indicus ou Penaeus monodon), eau, sel], CREME fraîche, carotte 4%, carotte jaune 4%, fève de SOJA 2%, champignon noir 2%, huile de tournesol, LAIT de noix de coco en poudre (contient LAIT), YAOURT maigre en poudre, arôme naturel (contient LAIT), épices curry 0.7% (coriandre, curcuma, ail, céleri, piment fort, gingembre), sel, sucre, épaississant: gomme xanthane. Soit 51% de riz basmati cuit aux légumes et 25% de sauces aux épices curry dans le produit.', 'https://static.openfoodfacts.org/images/products/325/622/608/5858/front_fr.19.400.jpg', '3.3', '1.4', '11', '1.5', '1.1', '7.3', '0.9', '0.354330708661417', '', '1');

