VALUES ('3256226087418', 'Chocolat noir fourré mangue-passion & ganache,', 'Fourrage mangue passion 30% [sirop de glucose- fructose, humectant: glycérol, sucre, jus concentré de mangue 0.9% (équivalent 3.8% de mangue), jus concentré de fruits de la passion 0.9% (équivalent à 3.3% de fruits de la passion), acidifiant: acide citrique, gélifiant: pectines, concentrés de carotte et de potiron, arômes, correcteur d\'acidité: citrates de sodium, eau], ganache 30% [sucre, beurre de cacao, BEURRE concentré, poudre de LAIT entier, pâte de cacao, cacao maigre en poudre, LACTOSÉRUM en poudre, émulsifiant: lécithines de tournesol, arôme naturel de vanille], sucre, pâte de cacao, beurre de cacao, BEURRE concentré, émulsifiant : lécithines de tournesol, arôme naturel de vanille. Cacao: 49% minimum dans le chocolat noir. Traces éventuelles de fruits à coque, de céréales contenant du gluten et d\'oeuf.', 'https://static.openfoodfacts.org/images/products/325/622/608/7418/front_fr.24.400.jpg', '27', '17', '57', '44', '4.3', '4.4', '0.08', '0.031496062992126', '', '0');

