VALUES ('3256226088989', 'Chocolat blanc écorces de citron,', 'Sucre, LAIT entier en poudre, beurre de cacao, pépites de citron 12% (écorce de citron 5,8 %, sirop de glucose-fructose, dextrose (BLE), sucre, arôme naturel, régulateur d\'acidité : acide citrique, conservateur : anhydride sulfureux (SULFITES), colorant : concentré de carotte noire), huile essentielle de citron, arôme, émulsifiant : lécithines de colza. Traces éventuelles de céréales contenant du gluten, oeuf, soja et fruits à coques.', 'https://static.openfoodfacts.org/images/products/325/622/608/8989/front_fr.28.400.jpg', '31', '19', '55', '53', '0.5', '7.7', '0.32', '0.125984251968504', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256226088996', 'Chocolat noir ananas éclats de noisettes,', 'Masse de cacao, sucre, pépites d\'ananas 12% (purée ananas, sucre, pomme, dextrose, agent gélifiant : alginate de sodium, arôme naturel, régulateurs d\'acidité : phosphates de calcium et acide citrique), éclats de NOISETTES hachées 8%, beurre de cacao, poudre de cacao dégraissé, arômes, émulsifiant : lécithines de tournesol. Cacao : 64% minimum de chocolat noir. Traces éventuelles de céréales contenant du gluten, de lait, d oeuf, de soja, et d\'autres fruits à coques.', 'https://static.openfoodfacts.org/images/products/325/622/608/8996/front_fr.34.400.jpg', '34', '18', '43', '38', '9.2', '8.5', '0.08', '0.031496062992126', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256226089009', 'Chocolat noir fraise et menthe,', 'Sucre, masse de cacao, pépites de fraises 15% (sucre, jus de fraise, dextrose, jus de citron, gélifiant : pectine, fibres d\'AVOINE, arômes naturels, colorant : jus concentré fruits rouge), beurre de cacao, émulsifiant : lécithines de colza, arômes. Cacao : 47% minimum dans le chocolat noir. Traces éventuelles de céréales contenant du gluten, de lait, d\'oeuf, de soja et d\'autres fruits à coque.', 'https://static.openfoodfacts.org/images/products/325/622/608/9009/front_fr.33.400.jpg', '24', '14', '60', '57', '6.7', '5.3', '0.02', '0.0078740157480315', '', '0');

