VALUES ('3256226089153', 'Boisson aux fruits pomme poire vanille,', 'Eau de source (France) 83.7%, jus de fruits à base de concentrés 12% (pomme 10%, poire 2%), sucre, acidifiant : acide citrique, colorant :caramel ordinaire, antioxydant : acide ascorbique, arôme naturel de pomme , arôme naturel de vanille, arôme naturel de poire, arôme naturel.', 'https://static.openfoodfacts.org/images/products/325/622/608/9153/front_fr.21.400.jpg', '3.5', '2.2', '4.6', '3.8', '0.8', '0.9', '0.03', '0.0118110236220472', '', '1');

