VALUES ('3256226089221', 'Rillettes de saumon rose du Pacifique', 'SAUMON rose du Pacifique sauvage (Oncorhynchus gorbuscha) 44.3%, eau, SAUMON Atlantique d\'élevage (Salmo salar) 14.9%, huile de tournesol, jus de citron concentré, concentré de tomate, protéines de LAIT, fibres de canne à sucre, oignons, sel, épaississants : farine de graines de caroube et gomme xanthane.', 'https://static.openfoodfacts.org/images/products/325/622/608/9221/front_fr.23.400.jpg', '13', '1.8', '1', '0.8', '1.9', '12', '1', '0.393700787401575', '', '1');

