INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256226089269', 'Cassoulet Toulousain', 'Eau, haricots blancs réhydratés 30%, saucisse de Toulouse cuite 16% [viande de porc (origine : France), gras de porc, blanc d\'OEUF, eau, sel, sucre, ail en poudre, oignon en poudre, poivre, boyau naturel], viande de porc traitée en salaison 8.5% [viande de porc (origine : France), eau, sel, dextrose, stabilisant : E451, conservateur : E250], concentré de tomate, graisse de canard 0,7%, farine de BLE, arômes naturels (dont GLUTEN), ail en poudre, oignon en poudre, sels minéraux de mer (sodium, potassium, magnésium, calcium), sel, poivre. Traces éventuelles de lait, céleri, moutarde, poisson, crustacés et mollusques', 'https://static.openfoodfacts.org/images/products/325/622/608/9269/front_fr.27.400.jpg', '6', '3.8', '7.7', '0.3', '4.3', '7.5', '0.75', '0.295275590551181', '', '1');

