VALUES ('3256226089276', 'Cassoulet toulousain', 'Eau, haricots blancs réhydratés 30%, saucisses de Toulouse cuites 16% [viande de porc (origine : France), gras de porc, blanc d\'OEUF, eau, sel, sucre, ail en poudre, oignon en poudre, poivre, boyau naturel], viande de porc traitée en salaison 8.5% [viande de porc (origine : France), eau, sel, dextrose, stabilisant : E451, conservateur : E250], concentré de tomate, graisse de canard (0.7% du poids net), farine de BLE, arômes naturels (dont GLUTEN), ail en poudre, oignon en poudre, sels minéraux de mer (sodium, potassium, magnésium, calcium), sel, poivre. Traces éventuelles de lait, céleri, moutarde, poisson, crustacés et mollusques.', 'https://static.openfoodfacts.org/images/products/325/622/608/9276/front_fr.27.400.jpg', '6', '3.8', '7.7', '0.3', '4.3', '7.5', '0.75', '0.295275590551181', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256226089405', 'Paëlla royale volaille et fruits de mer', 'Boite de garniture 800g : Morceaux de cuisses de poule non désossées (Origine : France) 28%*, eau, légumes 22%* (Carottes 11%*, petits pois 9%*, poivrons 2%*), MOULES du Pacifique (Mytilus Chilensis, élevées au Chili) 10%*, concentré de tomates, chorizo 2%* [viande de porc (Origine : France), gras de porc, épices et extraits d\'épices, sel, dextrose, ferments lactiques, conservateurs : ascorbate de sodium et nitrite de sodium], vin blanc, arômes naturels (contient LAIT et POISSON), sel, graisse de volaille, oignon en poudre, ail en poudre, piment.* Pourcentages exprimés sur la garniture. 1 coupelle de riz long étuvé 200g. 1 sachet d\'épices: curcuma, ail, piment doux, poivre. Traces éventuelles de céréales contenant du gluten, céleri, crustacés, moutarde et soja.', 'https://static.openfoodfacts.org/images/products/325/622/608/9405/front_fr.33.400.jpg', '4.7', '0.5', '19', '1.3', '1.2', '8', '1.1', '0.433070866141732', '', '0');

