VALUES ('3256226315634', 'Coffret repas salade', 'Salade composée à base de pâte alimentaire aux œufs entiers penne rigate cuite, salade mélangée verte et rouf d\'une madeleine aux œufs entiers frais et d\'une coupelle de vinaigrette au vinaigre balsamique, issus de llagriCl Ingrédients Salade composée* 265g : Pâte alimentaire aux Œufs entiers penne rigate* cuite 53% (eau, semoule de blé dur*, Œufs entiers*), salade* mélangée verte et rouge 18% (laitue* et chicorée*), tomate cerise* 7% de vache*, sel, coagulant microbien, acidifiant : acide lactique, ferment lactique), speck 6% [viande de porc* (origine : Union Européenne), sel, épices*, dextrose*, saccharose*, plantes : nitrite de sodium, antioxydant : ascorbate de sodium. Fumage au bois de hêtre], basilic*, huile de tournesol*, huile d\'olive vierge extra*, jus de citron concentré*, ail en poudre*, sel. Pourcentages exprimés sur la salade composée. Madeleine aux Œufs entiers frais* 25g : Farine de blé semi-complète*, sucre de canne*, œufs entiers frais* 21%, huile de colza*, sirop de riz*, beurre*, poudres à lever : phosphate monocalcique et bicarbonate de soude, sel, arômes naturels (contient alcool). Pourcentage exprimé sur la madeleine aux œufs entiers frais. Vinaigrette au vinaigre balsamique* 20g : Huile de tournesol*, vinaigre balsamique* 22% (vinaigre de vin*, moût de raisin concentré*), huile d\'olive vierge extra*, sel, poivre*. Pourcentage exprimé sur la vinaigrette au vinaigre balsamique. *Ingrédients issus de l\'agriculture biologique. Certains ingrédients de ce produit ne proviennent pas de France. Traces éventuelles de fruits à coque et soja.', 'https://static.openfoodfacts.org/images/products/325/622/631/5634/front_fr.4.400.jpg', '11', '2.5', '18', '4.2', '1.6', '6.3', '0.8', '0.31496062992126', '', '1');

