% (dont 55.5%* de pâte briochée saupoudrée dorée et 44.5%* de garniture) : farine de BLE , eau , BEURRE 10.5%* , poivrons rouges 8.9%* , courgettes 8.9%* , purée de tomate mi- réduite 6.2%* , oignons préfrits 4.4%* (oignons 4%*, huile de tournesol) , double concentré de tomate 3.2%* , abricots secs 2.5%*, mélange d épices et aromates 2.1%* (coriandre, cumin, gingembre, piment niora, curcuma, épices, cannelle, fagara, nigelle, fenugrec, cubebe, huile de tournesol, oignons, vinaigre d alcool, ail, huile d olive vierge extra, citron, sel), préparation pour sauce béchamel en poudre (LACTOSERUM, amidon transformé de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, poivre, muscade) , graines de pavot 1.5%*, farine de maïs , huile d\'olive vierge extra , sucre , poudres à lever : diphosphates, carbonates de potassium, phosphates de calcium , OEUF , sel , amidon modifié de pomme de terre, basilic, stabilisants : hydroxypropylméthylcellulose, gomme guar ,LACTOSE, farine de riz , ail en poudre , enzymes (hémicellulase et amylase) (contient GLUTEN) , OEUF en poudre , CREME en poudre, colorant : caroténoïdes , poivre noir , protéines de LAIT antioxydant : ANHYDRIDE SULFUREUX. Mini brioché tomate cerise épinards et feta 25% (dont 55.5%* de pâte briochée saupoudrée dorée et 44.5%* de garniture) : farine de BLE , eau, épinards 11.4%*, BEURRE 10.5%* , préparation de tomate cerise (9.6%* minimum) (demi tomate cerise mi- séchée, huile de colza, sel, origan, ail), FETA 8.6%*, préparation pour sauce béchamel en poudre (LACTOSERUM, amidon transformé de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, poivre, muscade), flocons de millet 1.5%*, farine de maïs , sucre , poudres à lever : diphosphates, carbonates de potassium, phosphates de calcium , OEUF , OEUF en poudre, amidon modifié de maïs, sel, menthe, LACTOSE, enzymes (hémicellulase et amylase) (contient GLUTEN), CREME en poudre, poivre noir, protéines de LAIT, 