INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256226386771', 'Salade poulet rôti et croûtons de Grana Padano AOP', 'Salade composée 205g : Mélange de salades 41% (scarole, frisée, chicorée rouge), OEUF dur 20%, émincé de filet de poulet traité en salaison rôti* 19% [viande de filet de poulet sans peau (origine : France) 15%, farine de BLE, dextrose, sel, arôme naturel], tomate cerise 14%, Grana Padano AOP 3% (LAIT de vache, sel, présure, conservateur : lysozyme d\'OEUF). Pourcentages exprimés sur la salade composée. *Produit décongelé, ne pas recongeler. Sauce Caesar 30g : eau, huile de colza, Parmigiano Reggiano AOP (parmesan) (LAIT) 12%, jaune d\'OEUF 5%, moutarde (eau, graines de MOUTARDE, vinaigre d\'alcool, sel), vinaigre balsamique (vinaigre de vin, moût de raisin concentré), sel, jus concentré de citron jaune 0.6%, ail 0.4%, acidifiant : acide lactique, amidon modifié de pomme de terre, épaississant : gomme xanthane, poivre. Pourcentages exprimés sur la sauce Caesar. Croûton grillé nature 15g : croûton (farine de BLE, huile de tournesol, sel, levure), huile de tournesol. AOP : Appellation d\'origine protégée. Traces éventuelles de céleri et soja.', 'https://static.openfoodfacts.org/images/products/325/622/638/6771/front_fr.32.400.jpg', '3.5', '1.4', '1.9', '1.4', '2.7', '8.2', '0.6', '0.236220472440945', '', '1');

