VALUES ('3256226398965', 'Couscous poulet merguez semoule aux raisins secs', 'Semoule de blé dur précuite réhydratée 30% [eau, semoule de BLE dur précuite, huile d\'olive vierge extra, raisin sec 0.6% (raisin sec, huile de coton, huile de colza), sel], haut de cuisse de poulet 25% [haut de cuisse de poulet (origine France) 24%, eau, colorant : caramel ordinaire, sucre de canne], mélange de légumes en proportions variables 18% (carotte, courgette, navet, CELERI branche, poivron rouge, poivron vert, pois chiche), eau, merguez 5% [poitrine de boeuf (origine : France), gras de mouton (origine : France), eau, poitrine de mouton (origine : France), sel, épices, dextrose, conservateurs : nitrite de sodium et ascorbate de sodium, colorant : extrait de paprika, arômes naturels. Boyau naturel de mouton], préparation aromatique en poudre (maltodextrine, amidon transformé de maïs, sel, légume et extrait de légume, épices, dextrose, farine de BLE, arômes naturels), gélatine alimentaire de boeuf, cumin, arôme naturel, colorant : extrait de paprika, harissa (piment, ail, coriandre, sel, carvi, acidifiant : acide citrique). Traces éventuelles d\'arachides, crustacés, fruits à coque, graines de sésame, lait, lupin, mollusques, moutarde, oeufs, poissons et soja.', 'https://static.openfoodfacts.org/images/products/325/622/639/8965/front_fr.10.400.jpg', '5.4', '1.7', '15', '2.5', '0.9', '6.9', '0.67', '0.263779527559055', '', '1');

